INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 0, 8, 7, 5118061, "フリーマーケット会場", "ペコリーヌとの出会い", 2834, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, "青空の下で謁見", 10118, 1, 2);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 0, 8, 7, 5118062, "フリーマーケット会場", "マホとの出会い", 2835, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, "未来の騎空団\nマスコット？", 10118, 1, 2);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 0, 8, 7, 5118063, "ランドソル市街地", "アキノとの出会い", 2837, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, "お嬢さまからの\n緊急依頼", 10118, 1, 2);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 0, 8, 18, 5118064, "フリーマーケット会場", "ジュンとの出会い", 4108402, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, "黄金色の悩みごと", 10118, 1, 2);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 0, 8, 18, 5118065, "フリーマーケット会場", "カオリとの出会い", 4107402, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, "白熱！　格闘大会！", 10118, 1, 2);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 1, 8, 16, 5118066, "オーエド町", "ニノンとの出会い", 9000227, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 0, "祭り太鼓はオーエドの華", 10118, 1, 2);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 0, 8, 19, 5118067, "フリーマーケット会場", "スズナとの出会い", 2101181, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, "人気者は遅れて\nやってくる", 10118, 1, 3);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 0, 8, 18, 5118068, "ランドソル市街地", "ナナカとの出会い", 4109402, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, "巫女・ミーツ・魔法少女", 10118, 1, 3);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 0, 8, 18, 5118069, "フリーマーケット会場", "キャル＆コッコロとの出会い", 4305402, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, "ネズ耳は二度なくなる", 10118, 1, 3);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 0, 8, 18, 5118070, "ランドソル市街地", "ユカリとの出会い", 4101402, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, "この出会いにカンパイ！", 10118, 1, 3);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 0, 8, 18, 5118071, "ランドソル市街地", "アオイとの出会い", 4106402, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, "陰陽アンサンブル", 10118, 1, 3);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (91002, 40, 1, 8, 7, 5118072, "フリーマーケット会場", "シノブとの出会い", 2836, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 0, "運試し十番勝負！", 10118, 1, 3);
INSERT INTO `v1_29efd88b3b7cd2858a34e5b9087a6f47191828ba20942d6296f789b0e0c45dff` VALUES (0, 0, 0, 0, 0, 5118600, 0, "オープニング", 0, 0, 10145115, "彼女たちの新たな日常", 10118, 0, 1);
